import { array } from "prop-types";
import {FaBlog as icon} from "react-icons/fa";

export default{
  name: "blog",
  title: "Blog",
  type: "document",
  icon,
  fields: [
    {
      name: "name",
      title: "Blog Title",
      type: "string",
      description: "Name of the blog",
      validation: Rule => Rule.required()
    },
    {
      name: "slug",
      title: "Slug",
      type: "slug",
      options: {
        source: "name",
        maxLength: 100,
      },
      validation: Rule => Rule.required()
    },
    {
      name: 'date',
      title: 'Publish Date',
      type: 'date'
    },
    {
      name: "description",
      title: "Description",
      type: "string",
      description: "A short overview of the blog",
      validation: Rule => Rule.max(100)
    },
    {
      name: "category",
      title: "Category",
      type: "array",
      of: [{type: "reference", to: [{type: "category"}] }]
    },
    {
      name: "content",
      title: "Content",
      type: "array",
      of: [{type: "block"}],
      description: "Blog content",
    },
    {
      name: "landing_image",
      title: "Landing Image",
      type: "image",
      options: {
        hotspot: true,
      }
    },
    {
      name: "thumbnail_image",
      title: "Thumbnail Image",
      type: "image",
      options: {
        hotspot: true,
      }
    },
    {
      name: "image_1",
      title: "Image 1",
      type: "image",
      options: {
        hotspot: true,
      }
    },
    {
      name: "image_2",
      title: "Image 2",
      type: "image",
      options: {
        hotspot: true,
      }
    },
  ]
}

